Pornstars Like it Big - April O'Neil - Hotel Cockafornia

April 04, 2011

April needs some excitement in her life. So, with advice from her boss, she decides to book a room at a very special exclusive resort. What makes this resort so special is that there are no locks on the hotel rooms and every room is laid out with cameras connected to the hotel lobby, allowing the guests to watch each other. This excites April and she decides to put on a show for the cameras and see who she can attract.
